export default function Portfolio({entries}){
// I want to return a list of entries

    return (
        <section>
            <h2>Things I've worked on</h2>
            <h3>Hotjar -- Product Support Specialist</h3>
                <p>Starting out in the Customer Support team back in 2018, when we were still being called Customer Heros, my initial remit was simple: help users get the most out of Hotjar!</p>
                <p>During 2019 My experience with content development made me ideally placed for helping with the task of writing content for the knowledge base.</p>
                <p>As 2020 came around, I was partnered up with the recordings team, as a Product Support Specialist charged with making sure the Support team was ready and able to provide support for this crucial piece of the product.</p>
            <h3>Manning Publications Co. -- Acquisition Editor</h3>
            <h3>Packt Publishing -- Acquisition Editor</h3>
            <h3>University of Nottingham -- Masters Degree - <em>Social and Global Justice</em></h3>
            <h3>University of Reading -- Bachelor's  Degree - <em>Ancient History</em></h3>
        </section>
    )
}
